import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import RegistrationPage from './pages/RegistrationPage'; // Импортируем страницу регистрации

const App = () => {
  return (
    <Router>
      <div>
        {/* Здесь могут быть другие компоненты/страницы */}
        <Switch>
          <Route path="/registration" component={RegistrationPage} />
          {/* Добавляем маршрут для страницы регистрации */}
          {/* Другие маршруты могут быть добавлены здесь */}
        </Switch>
      </div>
    </Router>
  );
};

export default App;
